import Button from "../components/Button";
import Header from "../components/Header";
import Navigator from "../components/Navigator";

const MyPage = () => {
    return(
        <div>
            <Header
                title="my page"
            />
            <Navigator/>
            <div><Button text="1번 선택지"/></div>
            <div><Button text="2번 선택지"/></div>
            <div><Button text="3번 선택지"/></div>
            <div><Button text="4번 선택지"/></div>
            <div><Button text="5번 선택지"/></div>
        </div>
    )
}

export default MyPage;
